@qyhsxdx Hi! It has been such a long time since I last compiled tensorflow on my own pi3. I suggested that you turn to the compiled versions, see [tensorflow on arm](https://github.com/lhelontra/tensorflow-on-arm/releases).  But first ,run
`strings /lib/arm-linux-gnueabihf/libm.so.6|grep GLIBC`
to check whether your device are supported by GLIBC 2.23.
